def obtener_metadatos(afiliacionesentrada, nodos, verticesfinal):
        vertices = []
        tiempos = []
        contador = 0
        verticesuchos=[]
        for articulo in afiliacionesentrada: #Cada articulo
            if len(articulo)<30000000:#print('Entry---->', contador)
                print(articulo)
                afiliaciones_entry = []
                for afiliacion in articulo: # Cada campo dentro de entry
                    local_afiliacion=[]
                    #print (campito.tag)

                    local_name = unidecode(afiliacion[0])
                    local_city = afiliacion[2]
                    local_country = afiliacion[1]


                    local_afiliacion += [local_name, local_city, local_country]

                    if len(local_afiliacion)>0:
                        control = []
                        for nodo in nodos:
                            #print(nodos)

                            if nodo[0] == local_afiliacion[0]:
                                control += 'a'
                                nodo[3] += 1

                        if len(control)<1:
                            nodos += [local_afiliacion+[1]]

                        if local_afiliacion not in afiliaciones_entry:
                            afiliaciones_entry += [local_afiliacion]
                        print(afiliaciones_entry)

                def angel1(normal,pedazo,control):
                    if (normal in pedazo):
                        control += 'a'

                largo = len(afiliaciones_entry)

                if largo > 1:
                    afiliaciones_entry.sort()
                    #print(afiliaciones_entry)
                    start = time.time()
                    for i in range(0, largo-1):
                        if i % 10 == 0:
                            print('Afiliacion ', i, ' de ', largo)
                        for j in range((i+1), largo):

                            hilos = []
                            der = [afiliaciones_entry[i][0], afiliaciones_entry[j][0]]

                            control = []
                            chunksize = int(math.ceil(len(vertices) / float(1)))

                            #print('der',der)
                            for i in range(1):

                                chunk=vertices[chunksize * i:chunksize * (i+1)]

                                t = Thread(target=angel1,
                                    args=(der, chunk,
                                          control))
                                hilos.append(t)
                                t.start()
                            for t in hilos:
                                t.join()
                            if len(control) < 1:
                                vertices += [der]

                            verticesuchos+=[der]

                        #print('fin hilos---', contador, ' de ', largo, '\n')

                    elapsed = (time.time() - start)
                    tiempos += [elapsed]
                    print ('FIN Entry -->', contador, '. tiempo de', elapsed)

            contador += 1

            #print(afiliaciones_entry)
            #print('SIGUIENTE')
        #
        verticesfinal += vertices
        verticesuchos.sort()

        print(len(verticesuchos))
        return tiempos


